(106, 43, 24, 'Bank Branch Manager', 'Full-Time', NULL, NULL, 'Banking Operations', 'Ambala, Sadar Bazaar, Ambala, HR', NULL, NULL, 'Work from Office', '0', 30000.00, 40000.00, 0.00, 'Salary', 0, NULL, 'null', '\"[\\\"Good Communication\\\"]\"', 1, 'Whatsapp', '0', NULL, '\"[]\"', NULL, '\"[\\\"Masters\\\",\\\"Chartered Accountant (CA)\\\",\\\"Chartered Accountant (CA)\\\"]\"', '<p>Bank Branch Manager (General) -</p>\r\n<p>\r\n</p>\r\n<h3>Education and Experience:</h3>\r\n<ul>\r\n<li>\r\n<p>We are an equal opportunity employer and value diversity at our company. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, or disability status. We welcome applications from all qualified individuals and encourage those from diverse backgrounds to apply.</p>\r\n</li>\r\n</ul>\r\n<p>\r\n</p>', NULL, NULL, 7, 10, 'Beginner', 'No Preference', '\"[\\\"Health Insurance\\\",\\\"Provident Fund\\\"]\"', 'Ambala cantt', NULL, 'manshu.developer@gmail.com', 'null', 0, 0, '2025-08-03 01:56:59', '2025-08-03 01:56:59', 0),
(107, 43, 23, 'Full Stack Developer', 'Full-Time', NULL, NULL, 'Full Stack Web Developer', 'Chandigarh, Sector 25, Chandigarh, CH', NULL, NULL, 'Work from Home', '0', 30000.00, 40000.00, 0.00, 'Salary', 0, NULL, 'null', '\"[\\\"SQL\\\",\\\"CI/CD\\\"]\"', 0, 'Whatsapp', '1', NULL, '\"[]\"', NULL, '\"[\\\"Graduated\\\",\\\"B.Sc (Hons.)\\\",\\\"Mathematics\\\"]\"', '<h1>\r\n<strong>Full Stack Developer</strong>\r\n<br>Skymore, a leading tech company, is seeking a highly skilled and motivated Full Stack Developer to join our dynamic team. The successful candidate will be responsible for designing, coding, and maintaining our web applications, ensuring they are efficient, scalable, and user-friendly.</h1>\r\n<p>\r\n</p>\r\n<h3>\r\n<strong>Key Responsibilities:</strong>\r\n</h3>\r\n<ul>\r\n<li>\r\n<p>Design, develop, and maintain full-stack applications, focusing on both the front-end (HTML, CSS, JavaScript) and back-end (Node.js, Python, Django, etc.)</p>\r\n</li>\r\n<li>\r\n<p>Collaborate with our team to define, design, and ship new features</p>\r\n</li>\r\n<li>\r\n<p>Ensure the performance, quality, and responsiveness of applications</p>\r\n</li>\r\n<li>\r\n<p>Identify and correct bottlenecks and fix bugs</p>\r\n</li>\r\n<li>\r\n<p>Participate in code reviews and contribute to our codebase</p>\r\n</li>\r\n<li>\r\n<p>Work with external data sources and APIs</p>\r\n</li>\r\n<li>\r\n<p>Understand the importance of security and data protection</p>\r\n</li>\r\n<li>\r\n<p>\r\n</p>\r\n</li>\r\n</ul>\r\n<h3>\r\n<strong>Qualifications:</strong>\r\n</h3>\r\n<ul>\r\n<li>\r\n<p>Intermediate level of English proficiency</p>\r\n</li>\r\n<li>\r\n<p>Up to 3.5 years of experience in Full Stack Development</p>\r\n</li>\r\n<li>\r\n<p>Strong understanding of software development principles and design patterns</p>\r\n</li>\r\n<li>\r\n<p>Proficiency in multiple programming languages (e.g., JavaScript, Python, Node.js)</p>\r\n</li>\r\n<li>\r\n<p>Experience with front-end frameworks (e.g., React, Angular, Vue.js)</p>\r\n</li>\r\n<li>\r\n<p>Knowledge of databases (e.g., SQL, NoSQL) and server technologies (e.g., Express.js)</p>\r\n</li>\r\n<li>\r\n<p>Familiarity with RESTful APIs and web services</p>\r\n</li>\r\n<li>\r\n<p>Excellent problem-solving skills and ability to work independently and in a team</p>\r\n</li>\r\n<li>\r\n<p>Strong communication and collaboration skills</p>\r\n</li>\r\n<li>\r\n<p>\r\n</p>\r\n</li>\r\n</ul>\r\n<h3>\r\n<strong>Education and Experience:</strong>\r\n</h3>\r\n<ul>\r\n<li>\r\n<p>Graduated level of education in B.Sc (Hons.), specializing in Mathematics</p>\r\n</li>\r\n<li>\r\n<p>Up to 3.5 years of experience in Full Stack Development</p>\r\n</li>\r\n<li>\r\n<p>A portfolio showcasing previous work or personal projects is highly desirable</p>\r\n</li>\r\n<li>\r\n<p>\r\n</p>\r\n</li>\r\n<li>\r\n<p>\r\n<strong>Application Process:</strong>\r\n</p>\r\n</li>\r\n<li>\r\n<p>Interested candidates are invited to submit their resume and a brief cover letter to manshu.developer@gmail.com. The selection process will include an online interview.</p>\r\n</li>\r\n<li>\r\n<p>Skymore is an equal opportunity employer and is committed to diversity and inclusion in its workforce. We encourage all qualified individuals to apply.</p>\r\n</li>\r\n<li>\r\n<p>We are an equal opportunity employer and value diversity at our company. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, or disability status. We welcome applications from all qualified individuals and encourage those from diverse backgrounds to app</p>\r\n</li>\r\n</ul>\r\n<p>\r\n</p>', NULL, NULL, 7, 10, 'Intermediate', 'Male', '\"[]\"', 'null', NULL, 'manshu.developer@gmail.com', 'null', 0, 0, '2025-08-03 11:22:26', '2025-08-03 11:22:26', 0),
(108, 43, 23, 'Backend Developer', 'Full-Time', NULL, NULL, 'Software Backend Development', 'Chandigarh, Sector 40, Chandigarh, CH', NULL, NULL, 'Work from Home', '0', 60000.00, 70000.00, 80000.00, 'Salary + Incentive', 0, NULL, 'null', '\"[\\\"Market Research\\\"]\"', 0, 'No Preference', '0', NULL, '\"[]\"', NULL, '\"[\\\"Graduated\\\",\\\"Bachelor\\\",\\\"Hospital Administration\\\"]\"', '<p>Backend Developer (General) -</p>\r\n<p>\r\n</p>\r\n<p>**<br>Skymore is seeking a dedicated and motivated Backend Developer to join our dynamic team. The ideal candidate will be responsible for designing, implementing, and maintaining the backend of our web applications, ensuring robustness, performance, and quality.</p>\r\n<h3>Key Responsibilities:</h3>\r\n<ul>\r\n<li>\r\n<p>Design, code, test, and maintain our backend services and APIs</p>\r\n</li>\r\n<li>\r\n<p>Collaborate with the frontend team to deliver complete software solutions</p>\r\n</li>\r\n<li>\r\n<p>Write reusable, testable, and efficient code</p>\r\n</li>\r\n<li>\r\n<p>Integrate the frontend elements with the backend, optimizing for responsiveness and performance</p>\r\n</li>\r\n<li>\r\n<p>Fix bugs and improve existing functionality</p>\r\n</li>\r\n</ul>\r\n<h3>Qualifications:</h3>\r\n<ul>\r\n<li>\r\n<p>Bachelor\'s degree in Computer Science, Information Technology, or a related field</p>\r\n</li>\r\n<li>\r\n<p>Proven experience as a Backend Developer</p>\r\n</li>\r\n<li>\r\n<p>Proficiency in backend programming languages such as Python, Java, or Ruby</p>\r\n</li>\r\n<li>\r\n<p>Knowledge of database systems such as MySQL, PostgreSQL, and MongoDB</p>\r\n</li>\r\n<li>\r\n<p>Experience with cloud-based solutions (AWS, Google Cloud, Azure)</p>\r\n</li>\r\n<li>\r\n<p>Familiarity with RESTful API design and JSON</p>\r\n</li>\r\n<li>\r\n<p>Strong problem-solving skills and attention to detail</p>\r\n</li>\r\n<li>\r\n<p>Excellent communication skills in English (Intermediate level)</p>\r\n</li>\r\n</ul>\r\n<h3>Education and Experience:</h3>\r\n<ul>\r\n<li>\r\n<p>Bachelor\'s degree in a relevant field</p>\r\n</li>\r\n<li>\r\n<p>Proven professional experience as a Backend Developer</p>\r\n</li>\r\n<li>\r\n<p>Proficient in at least one backend programming language</p>\r\n</li>\r\n<li>\r\n<p>Familiarity with cloud-based solutions and RESTful API design</p>\r\n</li>\r\n<li>\r\n<p>Strong English communication skills (Intermediate level)</p>\r\n</li>\r\n<li>\r\n<p>Skymore is an equal opportunity employer. We celebrate diversity and are committed to creating an inclusive environment for all employees. We encourage applications from all qualified candidates regardless of race, color, religion, gender, sexual orientation, national origin, disability status, protected veteran status, or any other characteristic protected by law.</p>\r\n</li>\r\n<li>\r\n<p>Interested candidates are invited to submit their application and resume through our online application system. Only selected candidates will be contacted for an interview.</p>\r\n</li>\r\n<li>\r\n<p>We are an equal opportunity employer and value diversity at our company. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, or disability status. We welcome applications from all qualified individuals and encourage those from diverse backgrounds to apply</p>\r\n</li>\r\n</ul>\r\n<p>\r\n</p>', NULL, NULL, 7, 10, 'Intermediate', 'Male', '\"[\\\"Remote Work\\\"]\"', 'null', NULL, 'null', 'null', 0, 0, '2025-08-03 11:32:27', '2025-08-03 11:32:27', 0);
